import react, { Component } from "react";

class DeleteButton extends Component {
  clickHandler() {
    console.log("button clicked");
  }

  render() {
    return (
      <div>
        <button onClick={clickHandler}>Delete</button>
      </div>
    );
  }
}
export default DeleteButton;
